import React from 'react'
import styled from 'styled-components'
import './Style.scss'

const HeaderNav = styled.div`
    display : flex;
    flex-direction : row;
    align-items : center;
    justify-content : center;
`;

class App extends React.Component {
    constructor() {
        super()
        this.state = {}
    }

    render() {
        return (
            <div className="header">
                <HeaderNav>
                <button href="#">
                    <i className="material-icons md-dark">arrow_back</i>
                </button>
                </HeaderNav>
            </div>
        )
    }
}

export default App
